import React from 'react'
import styled from 'styled-components';

const Our_Aim = () => {
  return (
    <>
    <Wrapper>
        <div className='container'>
            <div className='grid_two_column'>
                <div className='image'>
                    <img src="https://ftechiz.com/wp-content/uploads/2022/07/about.jpg" alt='aim_image' />
                </div>
                <div></div>
            </div>
        </div>
    </Wrapper>
</>
  )
}
const Wrapper = styled.section`
  padding: 12rem 0 0 0 ;
  .image{
    img{
    border-radius:1rem;
        width:60rem;
        height:30rem;
    }
  }
  `;
export default Our_Aim
